await robot.userRequest('参观服务');
const isHumanDetected = await robot.detectHuman();

if(isHumanDetected){
    const location = await robot.ask('欢迎参观，请问您想参观哪个地点？');

    await robot.goto(location);

    if(location == '创作开发区'){
        await robot.speak('这是我们的创作开发区，我们正在开发一款双臂机器人，它可以360度旋转。');
        await robot.goto('创作室');
        await robot.speak('这里是我们的创作室，我们正在开发虚实结合机器人测试平台。');
    }

    await robot.goto('接待区');
    await robot.speak('感谢您的参观！');

}else{
    await robot.speak('很抱歉，当前没有检测到人体，请稍后再来参观。');
}

